E_D("replace into `www_92game_net_6188net_ecms_news_data_1` values('2474','4','2472,2473,2471,2470,2469','1','0','0','0','日本美女,朝美,穗香,图片资料,','','','\n    <br />日本美女朝美穗香图片资料朝美穗香（英文名：Mihiro Taniguchi，1982年5月19日—），日本AV女优，中文网络社群仍习惯用日文假名称呼みひろ，原为知名写真女星，2005年移籍到AV界时曾引起不小轰动。<br />\n<img alt=\\\\\"日本美女朝美穗香图片资料\\\\\" src=\\\\\"/uploads/20150424/20150424175226713.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料\\\\\" />\n  \n    <br />在第一次从事A(和谐)V工作那天，导演对我说：“请尽情把脸对着摄影机，你的表情很上镜，看的人也会开心的！”他这番话直到现在我也还在实践中……在镜头面前表演色情感觉已经很专业了，而刚开始的时候没有足够的把握。对任何人来说，性爱都是一对一的吧？哪能和陌生人当着工作人员的面进行？可是在A(和谐)V世界，一女二男的3P游戏也很正常。我的私生活中没有过3P，和喜欢的人做的时候外加另外一个人，我想是绝对受不了的！如果和自己最喜欢的人当着自己的面跟别人做(和谐)爱的话，应该会对我造成一生的伤害吧！工作之余，老板会跟我聊聊天，或者是说些工作中的事情，也是感觉很情切的，他也有时候会发出感叹：做A(和谐)V女优也很辛苦的！要上镜的时候，他还回给我肯定的鼓励！演完的时候，男的还回问候声“辛苦了”、“怎么，不疼？”之类的话。就是A(和谐)V片也有剧本的，我通过剧本上的台词和男演员演床戏。男演员们也都很可亲，我从来没有遇到过可怕的。在工作休息的时间，工作人员会具体通知上镜时间，并且也都是非常有礼貌的进到我的卧室，我有单独的卧室可以休息。<br /><img alt=\\\\\"日本美女朝美穗香图片资料(2)\\\\\" src=\\\\\"/uploads/20150424/20150424175227714.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(2)\\\\\" />\n  \n    <br />在18岁来东京之前，我是在新泻的地方城市里长大的，一个极其平凡的女孩子……<br /><img alt=\\\\\"日本美女朝美穗香图片资料(3)\\\\\" src=\\\\\"/uploads/20150424/20150424175227715.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(3)\\\\\" />\n  \n    <br />我在跟我的好同学谈论工作的那一天，在往天上看的时候，飞机一直在天上轻轻的飞，我想我能做一名空姐就好了！我想要是做了空姐的话那真是太光彩了！可人家说不上专业的学校，是做不了这个的。可我一心还是想成为空姐，心想只要能找到在机场的工作就行，这样的工作还是有的。所以我决定了……<br /><img alt=\\\\\"日本美女朝美穗香图片资料(4)\\\\\" src=\\\\\"/uploads/20150424/20150424175228716.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(4)\\\\\" />\n  \n    <br />我想，我在涉谷被星探发现去做演员，我想成为演艺人，也想上电视！这是我跟好同学小沙说的真心话。她说，你到那里如果变了的话，我是一辈子都不会再接受你这个朋友了的……那天傍晚我第一次看见流星，于是我们一起许了愿……<br /><img alt=\\\\\"日本美女朝美穗香图片资料(5)\\\\\" src=\\\\\"/uploads/20150424/20150424175228717.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(5)\\\\\" />\n  \n    <br />几天后，我为了在机场的工作，出发去了我向往的东京……可真正的情况是，因为想成为艺人，才离开了新泻。那天昏昏欲睡的来到机场，第一天的工作很不顺畅，处理不好乘客的登机手续。离家了机场，在大街旁，我看到一位身着西服的男士在向过往的女生打招呼（其实是在问她们愿不愿意做模特），但很多人都不理会。我看明了情况，也是朝着他的方向径直走去，他也喊住了我，问我对模特这个工作感兴趣吗，他说他开了一家演艺事务所，他说，如果我愿意的话明天就可以=去上班。我惊讶的说：真的吗？他很肯定的回答……<br /><img alt=\\\\\"日本美女朝美穗香图片资料(6)\\\\\" src=\\\\\"/uploads/20150424/20150424175229718.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(6)\\\\\" />\n  \n    <br />此时我的男朋友走过来，他也跟我说，那你就做吧，做这行的多了！他走了，把我接到的名片甩在了地上，路人都匆忙地踩着路过……<br /><img alt=\\\\\"日本美女朝美穗香图片资料(7)\\\\\" src=\\\\\"/uploads/20150424/20150424175229719.jpg\\\\\" title=\\\\\"日本美女朝美穗香图片资料(7)\\\\\" />\n  ');");
